    // box-shadow: 10px 10px 5px #443535;
    // margin: 0px;
    // padding: 0px; 
    }

    return(
    <CSSTransition in={inProp} timeout={2000} 
    onMouseOver={() => setInProp(true)} 
    onMouseOut={() => setInProp(false)} 
    classNames="option">
        <div className="option">
          {props.children}
        </div>
      </CSSTransition>
    );
  };

  export default ProfileTile;
